import React from "react";

export default function Footer() {
  return (
    <footer
      style={{
        borderTop: "1px solid rgba(148,163,184,0.12)",
        background: "#091321",
        color: "#9fb0c3",
        textAlign: "center",
        padding: "18px 20px",
        fontSize: 14,
        lineHeight: "22px",
        letterSpacing: 0.1,
      }}
    >
      © {new Date().getFullYear()} Senluo Chen · Paris
    </footer>
  );
}
